import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCircleXmark, faMessagePen } from '@fortawesome/free-solid-svg-icons'
import "./Note.scss";
const Axios = require('axios').default;
const element = <FontAwesomeIcon icon={faCircleXmark} />
const edit = <FontAwesomeIcon icon={faMessagePen} />

function Note({note, getNote, editNote}) {

    async function deleting() {
        await Axios.delete(`http://localhost:4000/routers/${note._id}`)
        getNote();
    }

    return (

    <div className= "note">
    {note.name && <h2 className="heading">{note.title}</h2>}

    {note.title && <p className="desceription">{note.name}</p>}
    <button className="deleteButton" onClick= {deleting}><span className="icon">{element} </span></button>
    <button className="editButton" onClick={() => editNote(note)}>  {<span className="icon">{edit} </span>}</button>


    </div>
    )
};

export default Note;
